package server_api

import (
	"encoding/json"
	"testing"
)

func TestJSON(t *testing.T) {
	var valEntry InputJSON
	err := json.Unmarshal([]byte(JsonTestString), &valEntry)
	if err != nil {
		t.Fatal(err)
	}
	_, err = ValidationInputFromJson(&valEntry)
	if err == nil {
		t.Fatal("should have failed with default MaxWasmSize")
	}
	valEntry.MaxUserWasmSize = 512_000_000
	_, err = ValidationInputFromJson(&valEntry)
	if err == nil {
		t.Fatal("should have reject too large MaxWasmSize")
	}
	valEntry.MaxUserWasmSize = 4_000_000
	_, err = ValidationInputFromJson(&valEntry)
	if err != nil {
		t.Fatal(err)
	}
}

